import { Component } from "react";
import styles from './TopContainer.module.css';
import './TopContainer.css';

export default class TopContainer extends Component {
    constructor() {
        super();
    }

    mainContStyles = {
        'height': '100vh',
        'width': '100%',
        'marginLeft': '0%',
        'display': 'flex',
        'justifyContent': 'center',
        'alignItems': 'center',
        'flexDirection': 'column'
    }

    comp

    render() {
        return(
            <div style={this.mainContStyles}>
                <div className={styles.partContainer}>
                    <div id="sub-img-one"></div>
                    <div id="sub-img-two"></div>
                    <div id="sub-img-three"></div>
                </div>
                <div className={styles.headerContainer}>
                    <h1>Vedran Isak</h1>
                    <h3>Welcome to my portfolio site</h3>
                    <h3>A small showcase of my skills and experience</h3>
                </div>
                <div id="left-side-container" className={styles.sideContainer}>
                    <h3>Skills</h3>
                </div>
                <div id="bottom-side-container" className={styles.sideContainer}>
                    <h3>Experience</h3>
                </div>
                <div id="right-side-container" className={styles.sideContainer}>
                    <h3>Education</h3>
                </div>
                <div id="top-side-container" className={styles.sideContainer}>
                    <h3>Projects</h3>
                </div>
            </div>
        )
    }
}
